"use strict";function removeStylesheet(){var n=document.querySelectorAll('[BlazorStylesheet="true"]');n.length>0&&n.forEach(function(n){document.head.removeChild(n)})}function addStylesheet(n){if(n){var i=document.head,t=document.createElement("<style>");t.setAttribute("BlazorStylesheet","true");t.innerHTML=n;i.appendChild(t)}console.log(n)}window.updateStylesheet=function(n){removeStylesheet();addStylesheet(n);console.log("loaded")};